  const [data, setData] = useState([]);
  useEffect(() => {
    axios
      .get("https://breakingbadapi.com/api/characters")
      .then(res => setData(res.data));
  }, []);
  return (
    <div
      className="MyCards "
      style={{
        background: "url('./img/walter.png')",
        backgroundRepeat: "no-repeat",

        height: "100vh",
        backgroundSize: "cover"
